import React from "react";
import "./Footer.css"
function Footer() {
    return (
       <footer>
    <div id="all_lists">
        <div class="flist">
            <ul>
                ABOUT US
                <li><a href="/about">About Us</a></li>{/*Aim-*/}
                <li><a href="#">Careers</a></li>
                <li><a href="#">Contact Us</a></li>{/*Customer Care-*/}
                <li><a href="#">Rozgar Stories</a></li>{/*Achievement in earning-*/}
            </ul>
        </div>

        <div class="flist">
            <ul>
                HELP
                <li><a href="#">Work with Us</a></li>{/*details of payments-*/}
                <li><a href="#">How to Earn</a></li>{/*-*/}
                <li><a href="#">FAQ</a></li>{/*Customer care-*/}
            </ul>
        </div>

        <div class="flist">
            <ul>
                POLICY
                <li><a href="#">Terms of Use</a></li>{/*-*/}
                <li><a href="#">Security</a></li>{/*-*/}
                <li><a href="#">Privacy</a></li>{/*-*/}
            </ul>
        </div>
        <hr/>
        <div class="flist add">

                ADDRESS:
                <p>Rozgar Private Limited,<br/>Birla Institute of Technology<br/>Mesra, Ranchi-835215,<br/>Jharkhand, India</p>
        </div>
    </div>
    <br/><br/><br/>
    <div id="tc">
        <div>
            <i class="far fa-copyright"></i> 2021-2022 Rozgar.com
        </div>

        <div id="footericons">
            <a href="" title="Facebook"><i class="fab fa-facebook-square"></i></a>&nbsp;
            <a href="" title="Instagram"><i class="fab fa-instagram"></i></a>&nbsp;
            <a href="#" title="Mail"><i class="fas fa-envelope"></i></a>&nbsp;
            <a href="#" title="Youtube"><i class="fab fa-youtube"></i></a>&nbsp;
            <a href="#" title="Twitter"><i class="fab fa-twitter"></i></a>&nbsp;
            <a href="#" title="LinkedIn"><i class="fab fa-linkedin"></i></a>&nbsp;
        </div>
    </div>
</footer>
    );
}

export default Footer;
